import React from "react";
import "./ServiceBentoGrid.css";

const services = [
  {
    title: "Property Listings",
    desc: "Explore or list properties with 3D tours.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/home.png",
    bg: "/assets/bg1.jpg",
  },
  {
    title: "Analytics",
    desc: "Gain real-time performance insights.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/combo-chart.png",
    bg: "/assets/bg2.jpg",
  },
  {
    title: "Virtual Tours",
    desc: "Interactive property walkthroughs.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/360-view.png",
    bg: "/assets/bg3.jpg",
  },
  {
    title: "Market Trends",
    desc: "Understand pricing movements.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/line-chart.png",
    bg: "/assets/bg4.jpg",
  },
  {
    title: "Saved Homes",
    desc: "Bookmark properties for later.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/like.png",
    bg: "/assets/bg5.jpg",
  },
  {
    title: "Messages",
    desc: "Connect with property owners instantly.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/chat.png",
    bg: "/assets/bg6.jpg",
  },
  {
    title: "Tenant Screening",
    desc: "Vet applicants within the dashboard.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/approval.png",
    bg: "/assets/bg7.jpg",
  },
  {
    title: "Task Automation",
    desc: "Automate reminders & updates.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/automation.png",
    bg: "/assets/bg8.jpg",
  },
  {
    title: "Integrated Docs",
    desc: "Access deeds, reports & more.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/document.png",
    bg: "/assets/bg9.jpg",
  },
  {
    title: "Quick Search",
    desc: "Find properties by filter, fast.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/search.png",
    bg: "/assets/bg10.jpg",
  },
  {
    title: "Unified Dashboard",
    desc: "Manage all listings & leads.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/dashboard.png",
    bg: "/assets/bg11.jpg",
  },
  {
    title: "Support",
    desc: "24/7 platform assistance.",
    icon: "https://img.icons8.com/ios-filled/50/ffffff/help.png",
    bg: "/assets/bg12.jpg",
  },
];

const ServiceBentoGrid = () => {
  return (
    <section className="grid">
      {services.map((service, index) => (
        <div
          className="item"
          key={index}
          style={{ backgroundImage: `url(${service.bg})` }}
        >
          <div className="item-content">
            <img src={service.icon} alt={service.title} />
            <h3>{service.title}</h3>
            <p>{service.desc}</p>
          </div>
        </div>
      ))}
    </section>
  );
};

export default ServiceBentoGrid;
